	X['b'] += 0.5 * np.einsum('uv,wx,WX,iIwU,xXuI,vViW->VU', eta1['a'], eta1['a'], gamma1['b'], h['ab'][c,C,a,A], t['ab'][pa,pA,ha,hC], t['ab'][pa,pA,hc,hA], optimize=True)
