	X['aa'] += -1.0 * np.einsum('yIaU,zUyV,uVvI,waxz->uwvx', h['ab'][a,C,v,A], lambdas['ab'], t['ab'][pa,pA,ha,hC], t['aa'][pa,pv,ha,ha], optimize=True)
	X['aa'] += -0.5 * np.einsum('yIaU,zUyV,uVzI,vawx->uvwx', h['ab'][a,C,v,A], lambdas['ab'], t['ab'][pa,pA,ha,hC], t['aa'][pa,pv,ha,ha], optimize=True)
	X['aa'] += 1.0 * np.einsum('yUaA,zVyU,uAvV,waxz->uwvx', h['ab'][a,A,v,V], lambdas['ab'], t['ab'][pa,pV,ha,hA], t['aa'][pa,pv,ha,ha], optimize=True)
	X['aa'] += 0.5 * np.einsum('yUaA,zVyU,uAzV,vawx->uvwx', h['ab'][a,A,v,V], lambdas['ab'], t['ab'][pa,pV,ha,hA], t['aa'][pa,pv,ha,ha], optimize=True)
	X['aa'] += 0.25 * np.einsum('IJUV,UVWX,uWvI,wXxJ->uwvx', h['bb'][C,C,A,A], lambdas['bb'], t['ab'][pa,pA,ha,hC], t['ab'][pa,pA,ha,hC], optimize=True)
	X['aa'] += 0.5 * np.einsum('IJAB,uAvI,wBxJ->uwvx', h['bb'][C,C,V,V], t['ab'][pa,pV,ha,hC], t['ab'][pa,pV,ha,hC], optimize=True)
	X['aa'] += 1.0 * np.einsum('IUVA,VWUX,uAvW,wXxI->uwvx', h['bb'][C,A,A,V], lambdas['bb'], t['ab'][pa,pV,ha,hA], t['ab'][pa,pA,ha,hC], optimize=True)
	X['aa'] += -0.25 * np.einsum('UVAB,WXUV,uAvX,wBxW->uwvx', h['bb'][A,A,V,V], lambdas['bb'], t['ab'][pa,pV,ha,hA], t['ab'][pa,pV,ha,hA], optimize=True)
